function Stack(a){this.stack=a,this.mutationHandler=function(){},this.setHandler=function(b){this.mutationHandler=b},this.callHandler=function(){this.mutationHandler()},this.push=function(b){this.stack.push(b),this.callHandler()},this.pop=function(){this.stack.pop(),this.callHandler()},this.getStack=function(){return this.callHandler(),this.stack}}
